import React from "react";
import { reduxForm, Field } from "redux-form";
import { Input } from "antd";

let LoginForm_ = () => {
  // console.log("govno");

  return (
    <form>
      <div>
        <label> Name </label>
        <Field name="firstName" component={Input} />
      </div>
    </form>
  );
};

LoginForm_ = reduxForm({
  form: "login"
})(LoginForm_);

export default LoginForm_;
